import './login.css';
function Login (){


    return(
        <>
        
        <div class="container">
    <div class="logo">
      <img src="logo.png" alt="Your Company Logo"/>
    </div>
    <div class="intro">
      <h1>Your Company Name</h1>
      <p>Short introduction about your company.</p>
    </div>
    <div class="login">
      <a href="#">Login</a>
    </div>
  </div>
        
        </>
    );
}
export default Login;
